import React, { useState } from "react";
import NavBar from "@components/navBar"
import { useHistory } from "react-router-dom";
import '../style.scss'
const TimerList = () => {
 const [entryOrderFlag, setEntryOrderFlag] = useState(false)
 const [successOrderFlag, setSuccessOrderFlag] = useState(false)
 const entryOrder = () => {
  return (
   <div className="alert-container">
    <div className="on-sale-alert">
     <p className="alert-top">提示</p>
     <p className="alert-min">
      <span>领取后将扣除0.00,是否领取</span>
      <div className="item">
      <div className="left">
         <i className="def-bank-icon"></i>
         <span>中国邮政</span>
        </div>
        <div className="min">
         <span>【万】¥1890.00</span>
         <span>任务奖励:<i></i>29.00</span>
        </div>
        <div className="right">
         <span>领取倒计时</span>
         <span>1小时2分钟</span>
        </div>
      </div>
     </p>
     <p className="alert-bottom">
      <span onClick={() => {
       setEntryOrderFlag(false);
       setSuccessOrderFlag(true)
      }}>确定</span>
      <span onClick={() => setEntryOrderFlag(false)}>取消</span>
     </p>
    </div>
   </div>
  )
 }
 const successOrder = () => {
  return (
   <div className="alert-container">
    <div className="on-sale-alert">
     <p className="alert-top">提示</p>
     <p className="alert-min">
      <div className="item">
       恭喜您，领取成功
      </div>
     </p>
     <p className="alert-bottom">
      <span onClick={() => setEntryOrderFlag(true)}>确定</span>
     </p>
    </div>
   </div>
  )
 }
 return (
  <ul className="timers-wrap">
   {
    [1, 2, 3, 4, 5, 6, 7].map(item => {
     return (
      <>
       {successOrderFlag && successOrder()}
       {entryOrderFlag && entryOrder()}
       <li className="timers-item">
        <div className="left">
         <i className="def-bank-icon"></i>
         <span>中国邮政</span>
        </div>
        <div className="min">
         <span>【万】¥1890.00</span>
         <span>任务奖励:<i></i>29.00</span>
        </div>
        <div className="right">
         <span onClick={() => setEntryOrderFlag(true)}>领取</span>
         <span>领取倒计时</span>
         <span>1小时2分钟</span>
        </div>
       </li>
      </>
     )
    })
   }
  </ul>
 )
}
export default TimerList;
